CREATE TABLE gen1_games (
    id INTEGER NOT NULL PRIMARY KEY,
    gameName VARCHAR NOT NULL,
    shortName VARCHAR NOT NULL
);


CREATE TABLE gen1_game_versions (
    id INTEGER NOT NULL PRIMARY KEY,
    gameIndex INTEGER NOT NULL,
    versionName VARCHAR NOT NULL,
    shortName VARCHAR NOT NULL,
    FOREIGN KEY(gameIndex) REFERENCES gen1_games(id)
);


CREATE TABLE gen1_types (
    typeIndex INTEGER NOT NULL PRIMARY KEY,
    typeName VARCHAR NOT NULL,
    isSpecial BOOLEAN NOT NULL
);


CREATE TABLE gen1_type_effectiveness (
    attackType INTEGER NOT NULL,
    defendType INTEGER NOT NULL,
    modifier DECIMAL NOT NULL,
    PRIMARY KEY(attackType, defendType)
);


CREATE TABLE gen1_experiencecurve (
    curveIndex INTEGER NOT NULL PRIMARY KEY,
    name VARCHAR NOT NULL
);


CREATE TABLE gen1_pokemon (
    pokedexNumber INTEGER NOT NULL PRIMARY KEY,
    gameIndexNumber INTEGER NOT NULL,
    name VARCHAR NOT NULL UNIQUE,
    type1 INTEGER NOT NULL,
    type2 INTEGER NULL,
    heightMeters DECIMAL NOT NULL,
    weightKilograms DECIMAL NOT NULL,
    catchRate INTEGER NOT NULL,
    baseExperience INTEGER NOT NULL,
    experienceCurve INTEGER NOT NULL,
    baseHP INTEGER NOT NULL,
    baseAttack INTEGER NOT NULL,
    baseDefense INTEGER NOT NULL,
    baseSpeed INTEGER NOT NULL,
    baseSpecial INTEGER NOT NULL,
    cryBase INTEGER NULL,
    cryPitch INTEGER NULL,
    cryLength INTEGER NULL,
    classification VARCHAR NOT NULL,
    FOREIGN KEY(type1) REFERENCES gen1_types(typeIndex),
    FOREIGN KEY(type2) REFERENCES gen1_types(typeIndex),
    FOREIGN KEY(experienceCurve) REFERENCES gen1_experiencecurve(curveIndex)
);


CREATE TABLE gen1_pokedex_entries (
    pokedexNumber INTEGER NOT NULL,
    versionId INTEGER NOT NULL,
    entry VARCHAR NOT NULL,
    PRIMARY KEY(pokedexNumber, versionId),
    FOREIGN KEY(pokedexNumber) REFERENCES gen1_pokemon(pokedexNumber),
    FOREIGN KEY(versionId) REFERENCES gen1_game_versions(id)
);
