CREATE TABLE gen1_moves (
    gameIndexNumber INTEGER NOT NULL PRIMARY KEY,
    name VARCHAR NOT NULL,
    typeIndex INTEGER NOT NULL,
    basePower INTEGER NULL,
    basePP INTEGER NULL,
    accuracy INTEGER NULL,
    priority INTEGER NOT NULL,
    tmNumber INTEGER NULL UNIQUE,
    hmNumber INTEGER NULL UNIQUE,
    targetEnemy BOOLEAN NOT NULL,
    hasChargingTurn BOOLEAN NOT NULL,
    healRate DECIMAL NULL, -- Out of 100
    drainRate DECIMAL NULL, -- Out of 100
    primaryEffect VARCHAR NULL,
    secondEffect VARCHAR NULL,
    secondEffectChance DECIMAL NULL, -- Out of 256
    staticDamage DECIMAL NULL,
    effectMinTurns DECIMAL NULL,
    effectMaxTurns DECIMAL NULL,
    enemyStageModifier BOOLEAN NULL,
    attackStageModifier INTEGER NULL,
    defenseStageModifier INTEGER NULL,
    speedStageModifier INTEGER NULL,
    specialStageModifier INTEGER NULL,
    accuracyStageModifier INTEGER NULL,
    evasionStageModifier INTEGER NULL,
    FOREIGN KEY(typeIndex) REFERENCES gen1_types(typeIndex)
);


CREATE TABLE gen1_pokemon_levelup (
    pokedexNumber INTEGER NOT NULL,
    moveIndex INTEGER NOT NULL,
    gameIndex INTEGER NOT NULL,
    levelUp INTEGER NOT NULL,
    levelUpOrder INTEGER NOT NULL,
    PRIMARY KEY(pokedexNumber, moveIndex, gameIndex, levelUp, levelUpOrder),
    FOREIGN KEY(pokedexNumber) REFERENCES gen1_pokemon(pokedexNumber),
    FOREIGN KEY(moveIndex) REFERENCES gen1_moves(gameIndexNumber),
    FOREIGN KEY(gameIndex) REFERENCES gen1_games(id)
);












































































































































































































































































































CREATE TABLE gen1_pokemon_tmhmcompatability (
    pokedexNumber INTEGER NOT NULL,
    moveIndex INTEGER NOT NULL,
    gameIndex INTEGER NOT NULL,
    PRIMARY KEY(pokedexNumber, moveIndex, gameIndex),
    FOREIGN KEY(pokedexNumber) REFERENCES gen1_pokemon(pokedexNumber),
    FOREIGN KEY(moveIndex) REFERENCES gen1_moves(gameIndexNumber),
    FOREIGN KEY(gameIndex) REFERENCES gen1_games(id)
);



































































































































































































































































































CREATE TABLE gen1_locations (
    mapIndex INTEGER NOT NULL PRIMARY KEY,
    name VARCHAR NOT NULL,
    width INTEGER NOT NULL,
    height INTEGER NOT NULL
);


CREATE TABLE gen1_location_used (
    mapIndex INTEGER NOT NULL,
    versionId INTEGER NOT NULL,
    grassEncounterRate INTEGER NULL,
    waterEncounterRate INTEGER NULL,
    PRIMARY KEY(mapIndex, versionId),
    FOREIGN KEY(mapIndex) REFERENCES gen1_locations(mapIndex),
    FOREIGN KEY(versionId) REFERENCES gen1_game_versions(id)
);




CREATE TABLE gen1_location_warps (
    versionId INTEGER NOT NULL,
    fromMapIndex INTEGER NOT NULL,
    fromWarpIndex INTEGER NOT NULL,
    fromX INTEGER NOT NULL,
    fromY INTEGER NOT NULL,
    toMapIndex INTEGER NULL,
    toWarpIndex INTEGER NOT NULL,
    PRIMARY KEY(versionId, fromMapIndex, fromWarpIndex),
    FOREIGN KEY(versionId, fromMapIndex) REFERENCES gen1_location_used(versionId, mapIndex),
    FOREIGN KEY(versionId, toMapIndex) REFERENCES gen1_location_used(versionId, mapIndex),
    FOREIGN KEY(versionId, toMapIndex, toWarpIndex) REFERENCES gen1_location_warps(versionId, fromMapIndex, fromWarpIndex),
    FOREIGN KEY(versionId) REFERENCES gen1_game_versions(id)
);
