CREATE TABLE gen1_fishing (
    id SERIAL NOT NULL PRIMARY KEY,
    method VARCHAR NOT NULL,
    versionId INTEGER NOT NULL,
    locationId INTEGER NULL,
    slotIndex INTEGER NOT NULL,
    pokedexNumber INTEGER NOT NULL,
    pokemonLevel INTEGER NOT NULL,
    FOREIGN KEY(versionId) REFERENCES gen1_game_versions(id),
    FOREIGN KEY(locationId, versionId) REFERENCES gen1_location_used(mapIndex, versionId),
    FOREIGN KEY(pokedexNumber) REFERENCES gen1_pokemon(pokedexNumber),
    UNIQUE (method, versionId, locationId, slotIndex)
);



CREATE TABLE gen1_ingame_event_pokemon (
    id SERIAL NOT NULL PRIMARY KEY,
    gameId INTEGER NOT NULL,
    locationId INTEGER NOT NULL,
    x INTEGER NOT NULL,
    y INTEGER NOT NULL,
    pokedexNumber INTEGER NOT NULL,
    pokemonLevel INTEGER NOT NULL,
    method VARCHAR NOT NULL,
    itemIndex INTEGER NULL,
    FOREIGN KEY(gameId) REFERENCES gen1_games(id),
    FOREIGN KEY(locationId) REFERENCES gen1_locations(mapIndex),
    FOREIGN KEY(pokedexNumber) REFERENCES gen1_pokemon(pokedexNumber)
);


CREATE TABLE gen1_trade_pokemon (
    id SERIAL NOT NULL PRIMARY KEY,
    gameId INTEGER NOT NULL,
    locationId INTEGER NOT NULL,
    pokedexFromNumber INTEGER NOT NULL,
    pokedexToNumber INTEGER NOT NULL,
    name VARCHAR NOT NULL,
    FOREIGN KEY(gameId) REFERENCES gen1_games(id),
    FOREIGN KEY(locationId) REFERENCES gen1_locations(mapIndex),
    FOREIGN KEY(pokedexFromNumber) REFERENCES gen1_pokemon(pokedexNumber),
    FOREIGN KEY(pokedexToNumber) REFERENCES gen1_pokemon(pokedexNumber)
);



CREATE TABLE gen1_trainer_class (
    gameIndex INTEGER NOT NULL PRIMARY KEY,
    className VARCHAR NOT NULL,
    moneyBase INTEGER NOT NULL,
    aiModification VARCHAR NOT NULL,
    aiMaxTimes INTEGER NOT NULL
);


CREATE TABLE gen1_trainer_move_choice (
    gameIndex INTEGER NOT NULL PRIMARY KEY,
    description VARCHAR NOT NULL
);


CREATE TABLE gen1_trainer_class_move_choice (
    gameId INTEGER NOT NULL,
    classId INTEGER NOT NULL,
    choiceId INTEGER NOT NULL,
    PRIMARY KEY (gameId,classId, choiceId),
    FOREIGN KEY(gameId) REFERENCES gen1_games(id),
    FOREIGN KEY(classId) REFERENCES gen1_trainer_class(gameIndex),
    FOREIGN KEY(choiceId) REFERENCES gen1_trainer_move_choice(gameIndex)
);


CREATE TABLE gen1_trainers (
    gameId INTEGER NOT NULL,
    classId INTEGER NOT NULL,
    trainerId INTEGER NOT NULL,
    starterRequirement INTEGER NULL,
    romPartyPointer INTEGER NULL,
    PRIMARY KEY (gameId, classId, trainerId),
    FOREIGN KEY(gameId) REFERENCES gen1_games(id),
    FOREIGN KEY(classId) REFERENCES gen1_trainer_class(gameIndex),
    FOREIGN KEY(starterRequirement) REFERENCES gen1_pokemon(pokedexNumber)
);



CREATE TABLE gen1_trainer_object (
    locationId INTEGER NOT NULL,
    x INTEGER NOT NULL,
    y INTEGER NOT NULL,
    gameId INTEGER NOT NULL,
    classId INTEGER NOT NULL,
    trainerId INTEGER NOT NULL,
    objectId INTEGER NULL,
    direction VARCHAR NULL, -- 'u', 'd', 'l', 'r' 
    sightRange INTEGER NULL,
    PRIMARY KEY (locationId, x, y, gameId, classId, trainerId),
    FOREIGN KEY(locationId) REFERENCES gen1_locations(mapIndex),
    FOREIGN KEY(gameId, classId, trainerId) REFERENCES gen1_trainers(gameId, classId, trainerId),
    FOREIGN KEY(classId) REFERENCES gen1_trainer_class(gameIndex)
);



CREATE TABLE gen1_trainer_pokemon (
    gameId INTEGER NOT NULL,
    classId INTEGER NOT NULL,
    trainerId INTEGER NOT NULL,
    slotIndex INTEGER NOT NULL,
    pokedexNumber INTEGER NOT NULL,
    level INTEGER NOT NULL,
    move1Modification INTEGER NULL,
    move2Modification INTEGER NULL,
    move3Modification INTEGER NULL,
    move4Modification INTEGER NULL,
    PRIMARY KEY (gameId, classId, trainerId, slotIndex),
    FOREIGN KEY(gameId, classId, trainerId) REFERENCES gen1_trainers(gameId, classId, trainerId),
    FOREIGN KEY(pokedexNumber) REFERENCES gen1_pokemon(pokedexNumber),
    FOREIGN KEY(move1Modification) REFERENCES gen1_moves(gameIndexNumber),
    FOREIGN KEY(move2Modification) REFERENCES gen1_moves(gameIndexNumber),
    FOREIGN KEY(move3Modification) REFERENCES gen1_moves(gameIndexNumber),
    FOREIGN KEY(move4Modification) REFERENCES gen1_moves(gameIndexNumber)
);



CREATE TABLE gen1_items (
    hexIndex INTEGER PRIMARY KEY,
    name VARCHAR NOT NULL,
    isValidItem BOOLEAN NOT NULL,
    isKeyItem BOOLEAN NOT NULL,
    price INTEGER NOT NULL
);


CREATE TABLE gen1_field_items (
    versionId INTEGER NOT NULL,
    locationId INTEGER NOT NULL,
    x INTEGER NOT NULL,
    y INTEGER NOT NULL,
    itemIndex INTEGER NOT NULL,
    isHidden BOOLEAN NOT NULL,
    PRIMARY KEY (versionId, locationId, x, y),
    FOREIGN KEY(versionId, locationId) REFERENCES gen1_location_used(versionId, mapIndex),
    FOREIGN KEY(itemIndex) REFERENCES gen1_items(hexIndex)
);
-- INSERT INTO gen1_field_items VALUES (1, 111,  14,  11,  83, 1);


CREATE TABLE gen1_hidden_coins (
    versionId INTEGER NOT NULL,
    locationId INTEGER NOT NULL,
    x INTEGER NOT NULL,
    y INTEGER NOT NULL,
    amount INTEGER NOT NULL,
    PRIMARY KEY (versionId, locationId, x, y),
    FOREIGN KEY(versionId, locationId) REFERENCES gen1_location_used(versionId, mapIndex)
);


CREATE TABLE gen1_pokemart_inventories (
    location VARCHAR NOT NULL,
    slotId INTEGER NOT NULL,
    itemIndex INTEGER NOT NULL,
    PRIMARY KEY (location, slotId),
    FOREIGN KEY(itemIndex) REFERENCES gen1_items(hexIndex)
);


CREATE TABLE gen1_pokemon_evolution (
    fromPokedexNumber INTEGER NOT NULL,
    toPokedexNumber INTEGER NOT NULL,
    levelUp INTEGER NULL,
    itemIndex INTEGER NULL,
    isTrade BOOLEAN NOT NULL,
    PRIMARY KEY(fromPokedexNumber, toPokedexNumber),
    FOREIGN KEY(fromPokedexNumber) REFERENCES gen1_pokemon(pokedexNumber),
    FOREIGN KEY(toPokedexNumber) REFERENCES gen1_pokemon(pokedexNumber),
    FOREIGN KEY(itemIndex) REFERENCES gen1_items(hexIndex)
);

CREATE TABLE gen1_charmap (
    id INTEGER NOT NULL PRIMARY KEY,
    hexIndex INTEGER NOT NULL,
    character VARCHAR NOT NULL
);

